def composition_k(text, k):

    k_mers = []

    for i in range(len(text) - k +1 ):

        k_mer = text[i:i + k]

        k_mers.append(k_mer)

    return k_mers
 
# Input
k = 100
text = """"""


# Find composition k
result = composition_k(text, k)

# Output
print(' '.join(map(str, result)))

